import { Container, Row, Col, Placeholder } from 'react-bootstrap';

import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { BrowserRouter as Router, Routes, Route, NavLink } from 'react-router-dom';

import halfbyte from "../works/halfbyte.png";
import upcancer from "../works/upcancer.png";
import likeex from "../works/likeex.jpg";

import About from "../pages/About";
import Contact from "../pages/Contact";
import Home from "../pages/Home";


export default function Other() {
    return (
        <Container class="wrapper">
    
            <Row className='galleryP'>
                <h1 className='mb-3'>/work</h1>
                <div class="wrapper">
                    <div class="media">
                        <div class="layer">
                            <p>+ UI/UX Design</p>
                        </div>
                        <img src={likeex} alt="" />
                    </div>
                    <div class="media">
                        <div class="layer">
                            <p>+ UX Research</p>
                        </div>
                        <img src={upcancer} alt="" />
                    </div>
                    <div class="media">
                        <div class="layer">
                            <p>+ Game Development</p>
                        </div>
                        <img src={halfbyte} alt="" />
                    </div>
                </div>
            </Row>
        </Container >
    )
}
